INSERT INTO `notes` VALUES (16,6,0,'Backstory: Arrested after he fled from a traffic accident that he caused in Taos, Mexico. He was charged with careless driving, fleeing the accident and not informing police of the accident. He received a $250 fine and spent 20 minutes in jail.'),(12,6,0,'Backstory:\r\n\r\nArrested in Rochester, New York in March 1976 on a felony pot possession charge. During his Thin White Duke era and 29 at the time, he was arrested with Iggy Pop and two other co defendants at a Rochester hotel following a concert. Bowie was held in the Monroe County jail for a few hours before being released. The Rochester Police Department mug shot was taken three days after Bowie\'s arrest, when the performer appeared at City Court for arraignment.'),(2,6,0,'Backstory:\r\n\r\n1970 Washington, DC.'),(8,6,0,'Backstory:\r\n\r\nDecember 9, 1967 marked the first of many incidents while in concert. During a show in New Haven, Connecticut he was arrested for attempting to incite a riot by telling the crowd that the police had sprayed him with mace backstage just before the concert.'),(1,4,0,'Backstory:\r\n\r\nThis is the first time I have used one of my own photographs in a screen print. Taken February 2007 South Central LA.'),(2,9,3,''),(1,9,2,''),(5,7,0,'Backstory:\r\n\r\nLou Reed, \"Transformer\" Kings Cross, London 1972'),(2,7,0,'Backstory:\r\n\r\nDavid Bowie as Ziggy Stardust, Earls Court, London 1973'),(1,7,0,'Backstory:\r\n\r\nDavid Bowie as Ziggy Stardust, Santa Monica, California 1972'),(3,7,0,'Backstory:\r\n\r\nIggy Pop, Kings Cross, London 1972'),(4,7,0,'Backstory:\r\n\r\nLou Reed, Great Newport Street, London 1975');
