 \\\'\\\'They shot out his tires in South Carolina. He was running on two steel rims on the front. He drove about six miles like that,\\\'\\\' said Sgt. J.W. Wylds of the August Police Department. Mr. Brown was carrying a shotgun when stopped, Augusta police said. SEPT. 25, 1988 New York Times',2002,'Acrylic paint screen print on canvas','62 x 48',6,1,'',0),(126,'JANE FONDA','Jane Fonda was arrested on November 3, 1970, in a Cleveland, Ohio, airport for kicking a police officer and smuggling drugs. Fonda, however, insists that she was targeted by the Nixon White House for her progressive and anti-war political views.',2007,'Acrylic paint screen print on canvas','62 x 48',6,1,'',0),(127,'JANE FONDA','magenta',2007,'Acrylic paint screen print on canvas','62 x 48',6,1,'',0),(128,'JANE FONDA','Jane Fonda was arrested on November 3, 1970, in a Cleveland, Ohio, airport for kicking a police officer and smuggling drugs. Fonda, however, insists that she was targeted by the Nixon White House for her progressive and anti-war political views.',2007,'Acrylic paint screen print on canvas','62 x 48',6,1,'',0),(129,'JANE FONDA','Jane Fonda was arrested on November 3, 1970, in a Cleveland, Ohio, airport for kicking a police officer and smuggling drugs. Fonda, however, insists that she was targeted by the Nixon White House for her progressive and anti-war political views.',2004,'Acrylic paint screen print on canvas','37 x 29',6,1,'',0),(130,'JANE FONDA','',2007,'Acrylic paint screen print on canvas','62 x 48',6,1,'',0),(131,'JANIS JOPLIN','Janis Joplin was arrested in November 1969 in Florida and charged with disorderly conduct after yelling obscenities at police officers during a Tampa concert. Charges were later dropped after it was ruled that the singer\\\'s actions were an exercise of free speech.',2002,'Acrylic paint screen print on canvas','62 x 48',6,1,'',0),(132,'JIM MORRISON','Jim next arrest was on December 9, 1967, in New Haven, Connecticut.  He was booked on charges of in