INSERT INTO `series` VALUES (1,'NEW YORK GRENADE',1,'In his latest body of work, New York Grenade, Russell Young literally blows up the image of a World War II model hand grenade. California based American British artist detonates the motif through shifts in scale, color, and texture. Its formal attributes magnified and enhanced, the larger-than-life figure of a lethal weapon evokes the voluptuousness of a ripe fruit, conjuring associations with the shapeliness and grid-patterned skin of a pineapple or the curvy silhouette concealing the glistening ruby red flesh of a pomegranate, from which the deadly device takes its name (grenade in French). For this series of twenty-six unique, large-format screen prints on canvas, Young marshals striking color contrasts to an explosive effectâcombining yellows, hot pinks and deep crimsons with grayscale tones that allude to the photographic medium at the source of his practice. The sumptuous surface treatment of the paintings, a gleaming coat of diamond dust, adds dazzle to their seductive allure.\r\n\r\nWhat may at first glance appear a departure from the artistâs ongoing examination of glamour, counterculture rebellion, the myth of the American dream and its dark underbelly through figurative imagery culled from popular entertainment and the press, in these âportraitsâ of a destructive object, Young enlists similar techniques and materials to provocatively probe the same themes, albeit more abstractly or obliquely perhaps.\r\n\r\nWith a salute to Warholâs iconic stature, Young deploys a pop aesthetic to focus a singular lens on the complexities of American culture, its values, and underlying violence. Offering an original perspective on the illusory and shadowy aspects of celebrity, notoriety and infamy he explored in earlier worksâfrom the mug shots of famous people in Pig Portraits (2003) to Fame and Shame (2007) Jackie O (2010), Dreamland (2011), Helter Skelter (2014), Superstar (2016), or Femme Fatale (2017)âin this new series, the artist continues to address related concerns, capturing the brutality, fragility and meeting nature of life through the beautiful yet ominous form of the grenade.\r\n\r\nA counterpoint to the ambient bleakness of his childhood in Northern England, Young employs a vivid palette of diamond-encrusted paint to create stunning, compelling pictures, whose luminous qualities reflect the glitzy glare of his adoptive Southern California while casting light on the dualities pervading our world.',15,0),(2,'DIAMOND DUST',1,'\'Then light falls on the diamonds and the choir sings\' - Russell Young, ',9,0),(3,'FAME+SHAME',1,'FAME\r\nA collection of paintings and recollections exploring the \"American Dream\" through a series of gritty, sparse yet beautiful images, that together create a \"pop art cocktail\" of the past three decades of American counter culture, as seen through the eyes of a young man growing up in the North of England, paired with the witty titles and biting satire of northern \"football terrace\" humour...\"Come and have a go if you think you\'re hard enough.\"\r\n\r\nSHAME\r\nA series of paintings exploring the dark side of the \"American Dream\" shining a light on the inevitable fall out and resulting chaos that comes from three decades of cultural excess the result being a brutal and brooding catalogue of character\'s and events that both glamorise and chastise in equal measure...\"shelve your western plans\".',23,0),(4,'OBAMA',1,'In 2006 artist Russell Young was inspired to pick up his camera and photograph then underdog presidential candidate Senator Barack Obama. Over the next few years, Young created a series of works based upon those photographs he took. The works remained in Young\'s archives until just weeks ago when he was contacted by gallery owner Rhonda Long-Sharp. Long-Sharp watched Young create many of the Obama portraits almost 10 years ago. Together they now launch the renamed Obama Legacy Portrait Series.\r\n\r\n\"People will debate the importance of Barack Obama\'s actions as the 44th President of the US\" said Long-Sharp \"but what is beyond debate is his legacy as the first person of color to be the leader of the free world\". Long-Sharp, who grew up in a multi-racial neighborhood, was inspired recently when she heard it expressed that there are children in the United States who have \"never known anything but a Black president. I can\'t get that thought out of my mind. It makes me very proud to be an American. It also strengthens my confidence that no matter how difficult times seem, justice and fairness will prevail if we fight for them\".',26,0),(5,'GRAFITTI + PUNK',0,'',36,0),(6,'PIG PORTRAITS',1,'Pig Portraits is about the glamour in the dark side of crime, fame, sex, drugs and rock and roll. \r\n\r\nCulled from Police booking photographs commonly called Mug Shots, the colorful collection of Young\'s \'Pig Portraits\' subtly question the nature of photography, portraiture and the double-edged sword of celebrity itself. Juxtaposed against his earlier portraits, these images are sometimes considered \'anti-celebrity\', when in fact, they create a bold tribute, demonstrating a youth and rebellion that we can all relate to and appreciate.',19,0),(7,'REBEL REBEL',1,'I was 12 years old when I first saw David Bowie live as Ziggy Stardust, it was on the 4th September 1972 that Ziggy lit up Liverpool\'s dreary working-class venue the Top Rank. That night changed me forever. Glam, light, sexual ambiguity and optimism, a whole new vocabulary entered my life, and it was a wonderful escape from the daily violence of my youth. I now knew there was a place that was better than this and Ziggy took me there.\r\n\r\n\"There\'s a starman waiting in the sky\r\nHe\'d like to come and meet us\r\nBut he thinks he\'d blow our minds\"\r\n\r\nRebel Rebel is a collaborative series with the rock photographer Mick Rock, with paintings of Davis Bowie, Lou Reed, and Iggy Pop.',32,0),(8,'WHITE RABBIT',1,'Christmas 1967, I was seven years old, my Christmas present was a record player with two 45âs, âPurple Hazeâ by Jimi Hendrix and âLight my Fireâ by The Doors, my life was never to be the same. \r\n\r\nThis series of paintings is a unique collaboration with internationally acclaimed photographer Henry Diltz; Henry allowed me to delve into his archives of negatives and prints from the sixties and seventies.\r\n',33,0),(9,'DIRTY PRETTY THINGS',1,'American Glamour and the dark tragedy that lies just beneath the surface of these Hollywood icons. The American Dream, celebrity, crime, addiction and death are all themes Young explores in his work. His collection \"Dirty Pretty Things\" focuses on notoriously tragic stars like Marilyn Monroe and Kurt Cobain ',27,0),(10,'PERSONAL JESUS',0,'',35,0),(11,'GUNS',1,'Well, to tell you the truth, in all this excitement, I\'ve kinda lost track myself. But being this is a .44 Magnum, the most powerful handgun in the world, and would blow your head clean off, you\'ve got to ask yourself one question: \'Do I feel lucky?\' Well, do ya, punk?\r\n\r\nYoung ongoing series of guns diamond dusted, printed in his own blood explores the fragility of life. At Miami Art Basel, the artist explored the negative side of our culture in a live performance. Young - soaked in sweat and tears - demonstrated his unique screen-printing style, using his blood to create screen prints of guns. ',28,0),(12,'1-800-THE LOST',0,'',34,0),(13,'GLAMOUR',1,'As an artist, Russell Young has long been captivated by the contradiction of the myth and reality of the \"American Dream\". Celebrated for his transformations of cultural icons through the process of silk screen printing, his finished works depict the jaded reality of glamorous excess of 21st-century America.',25,0),(14,'HELTER SKELTER',1,'In December 1969, at Northern California\'s Altamont Speedway track in front of a 300,000 strong audience an armed and amphetamine-fueled Meredith Hunter is beaten to the floor and killed by Hells Angels to the strains of \"under your thumb\".  Killing dead the youthful idealism born of the \"flower power\" generation at Woodstock just four months earlier, this stark and apparently random still captured the moment when music gave way to mayhem madness and ultimately murder.\r\n\r\nThrough studying and dissecting this source image Young began to experiment using it as a tool to create, rather than as an end in itself. The Helter Skelter paintings are the result of this experiment, a violent and angry dance in which the artist uses the screen as his brush, physically walking around and into the canvas, there is no intended beginning and no certain end rather an urgent overlap that paints its own story, a vortex of anger, energy and excitement.',14,0),(15,'THIS LAND IS MY LAND',1,'âI\'ve roamed and rambled and I\'ve followed my footsteps\r\nTo the sparkling sands of her diamond deserts\r\nAnd all around me, a voice was sounding\r\nThis land was made for you and me\"\r\nWOODIE GUTHRIE\r\n\r\n \r\nâTHIS LAND IS MY LANDâ, a series of ten diamond dust paintings, continue the British born artistâs epic visual meditation on America and American celebrity culture.\r\n\r\nIn this his latest outing the artist Russell Young continues to explore the conflict and duality that informed his childhood vision of the American dream, inspired by the classic Woodie Guthrie anthem he has created a body of work that challenges our perceptions by contrasting two sets of images against each other, those of the American Indians who originally settled the land pitted against the faux American Cowboys created by the Hollywood studio system. \r\n\r\nIn this series, Young presents a provocative juxtaposition on the enduring mythologies of the American West. The proud and stoic face of Geronimo stares out at the viewer, clothed in a cavalry officers uniform in a vain attempt to humiliate and undermine his powers, he sits in direct contrast to a nervous Jon Voight who\'s flawed character Joe Buck becomes hopelessly undone by the gritty reality of modern day America.\r\n\r\n\"This Land is my land\" Polk Museum, Florida.\r\n\r\nIn Youngâs powerful portraits of Native American Indian chiefs. Although they bear no association with modern American celebrity, such portrayals of Native Americans have been ironically used to romanticize American heritage. The 19th-century American displacement of native Indian tribes during western expansion was framed with the gilded ideals of colonialism. Manifest Destiny, the idea that America was destined to stretch from coast to coast, sparked a genocide of hundreds of Native American tribes and endangered hundreds of others. Young represents this idea of cultural expansion and enforcement. In these portraits, the diamond dust signifies something sinister; the stark contrast between the sacred Native American values represented by the chiefs and the modern material affluence represented by diamond dust is disturbing. Similar to Youngâs other works, these portraits retain the separation of reality and perception. Yet, unlike his portraits of Hollywood celebrities, his depictions of Native Americans hit us a bit deeper in the gut. ',18,0),(16,'AMERICAN ENVY',1,'Young\'s \'American Envy\' series is his latest examination of American society, and addresses the idea of the American dream, exposing its fragility. By way of explanation, he says: \"Am I asking you to witness my own personal souring of the American dream, or are you being given a deeper glimpse of my life long obsession with American Counter culture?\" His images pay homage to Andy Warhol, the original embalmer of celebrity, and he creates silkscreen prints on one of the printing presses originally used by Warhol. Yet Young\'s style is completely unique, and he is renowned for his energetic live performances, where he demonstrates his ability to capture iconic images on canvas\r\n\r\nThe \"American Envy\" series shatters the illusion of the American Dream, with screen prints such as \"Elvis TV\", referring to Memphis Tennessee in 1966 when a young Aaron Elvis Presley shot the screen out of his television, the crackling sound of interference silenced by a single shot, juxtaposed with an image of a smiling Elvis holding a pistol in \'Elvis Pistol\'. A young Jackie âOâ gazes coquettishly at the camera in \"Jackie\", but some years later, when a single bullet penetrates the windshield of JFK\'s Lincoln Continental, her seemingly perfect world is destroyed along with the hopes and dreams of a generation. \"Float like a butterfly, sting like a bee\", shows the upside of the American dream, portraying young black boxer Cassius Marcellus Clay Jr, who changed his name to Muhammad Ali and propelled himself to stardom through sheer will and determination, silencing critics and challenging the prejudices of a nation along the way.',17,0),(17,'BOOKS',1,'AMERICAN ENVY BOOK\r\nRussell Young handprinted each individual book over a two year period in NY and his California studios whilst creating the American Envy series of paintings.\r\n\r\nRussell Young\'s \'American Envy\' series of paintings is an examination of American society, and addresses the idea of the American dream, exposing its fragility. By way of explanation, he says: \"Am I asking you to witness my own personal souring of the American dream, or are you being given a deeper glimpse of my lifelong obsession with American Counterculture?\"\r\n\r\nHELTER SKELTER BOOK\r\nIn December 1969, at Northern California\'s Altamont Speedway track in front of a 300,000 strong audience, an armed and amphetamine-fueled Meredith Hunter is beaten to the floor and killed by Hells Angels to the strains of \"under your thumb.\" Killing dead the youthful idealism born of the \"flower power\" generation at Woodstock just four months earlier, this stark and apparently random still captured the moment when music gave way to mayhem madness and ultimately murder.\r\n\r\nThrough studying and dissecting this source image Young began to experiment using it as a tool to create, rather than as an end in itself. The Helter Skelter paintings are the result of this experiment, a violent and angry dance in which the artist uses the screen as his brush, physically walking around and into the canvas, there is no intended beginning and no certain end rather an urgent overlap that paints its own story, a vortex of anger, energy and excitement.\r\n\r\nBetween 2010 and 2014 Russell Young was immersed in his Helter Skelter paintings. This book records that series of work.\r\n\r\nGOAT BLOOD BOOK\r\nIn 2009 Russell Young traveled by boat to Ithaca to perform Goat Blood, an investigation into printing, inspired by the Shroud of Turin and ideas that had been rolling around in his head for years. This book documents that performance and Young\'s use of the blood as the pigment and himself as the image imposed upon the linen of a dear friend. The photographs of the performance are presented in this hand-bound book, in four color screen prints, as a testament to the physicality of the process of an idea moving from glimmer to stone.',4,0),(18,'THE QUEEN IS DEAD',1,'The Smiths song title \"the Queen is Dead\" was the inspiration for this series, lyrics from Morrissey of The Smiths and Ian Curtis of Joy Division, words both amusing and sarcastic are boldly placed over some of Young\'s favorite Icons.\r\n\r\n\"Best of all, they give a thorough portrait of how it feels to be an outsider, rooted in a precise physical and psychological place ? \"hemmed in like a boar between arches\". When you hear the line \"but the rain that flattens my hair\" you can think of no other place than Manchester, and in many ways, The Queen Is Dead represents the highpoint of Morrissey\'s lyric writing? when he was still informed by his city and its past.\"',29,0),(19,'ONLY ANARCHISTS ARE PRETTY',1,'So from the start, the odds were probably against Only Anarchists Are Pretty, the seven huge enamel screen prints engulfing the Goss-Michael Foundation\'s front gallery. God, they\'re bold. Colorless images of women in bondage are scattered over each canvas, all repeating the same handful of images with duplicates arranged topsy-turvy inside each composition. The images swallow you whole the second you enter the gallery, and the shock and edginess is something expected of Goss-Michael, so you marvel at the nerve and feel delighted. Moving from canvas to canvas, you think, \"This is awesome\". Weirdly maybe, I didn\'t automatically see the women as in distress, you can\'t see their faces so you can\'t see fear, and kinky sex is among us and frequently visits our visual culture, and I don\'t jump to women-as-victims assumptions naturally or willingly. But I stood there a while, having inspected each canvas, catching the rhythm from the room, noting the elements the artist whited out, noting the one recurrent shot of a pair of male hands tying a knot over a bound naked woman, and realized I was surrounded. The longer you stand in the middle, surrounded, the more you feel just that surrounded. I was holding my breath. Fight or flight? Or stand there like a dumbass not able to move and in total denial that you don\'t have control of the situation? Yeah, kind of like that.\r\n\r\nReview Betsy Lewis, Glasstire.',24,0),(20,'RAPTORS',0,'',37,0),(21,'DEATH OF A DISCO DANCER',1,'In Death of a Disco Dancer, Young draws from tumultuous events in his own life, the result of which is deep!y personal series seminal in the artist\'s career.\r\n\r\nIn February 2010, Russell Young was admitted to Cottage Hospital in Santa Barbara and diagnosed with the H1 N1 virus, pneumonia, and ARDS. Young was in an 8-day induced coma with doctors and loved ones skeptical of recovery. He emerged from his near-death experience with an incredibly weak body. Little by little, he built back his strength and began examining his life and his surroundings in a whole new way. \"I left the hospital, and I had to learn to breathe, write, draw, think and walk for the second time in my life,? said Young. The pivotal moment in this second learning process was the rediscovery of color, he had forgotten what the color green was. With colored pencils and pads of paper, Young began coloring square blocks of bright blues, purples, reds, and yellows. After filling journal upon journal with color blocks, he slowly regained the strength to screen print four large-scale color-field prints. Screen prints he titled Death of a Disco Dancer after The Smiths\' album. \r\n\r\nThe light can never exist without the dark. And through the darkness of his illness, Russell found the color and light of art. ',31,0),(22,'THE FIGHT OF THE PASO DEL MAR',1,'In a departure from Young\'s usual subject matter, The Fight of the Paso del Mar series from 2012 takes inspiration from the poem of the same name by American poet Bayard Taylor (1825-1878). Inspired by San Diegan folklore, it speaks of the Paso del Mar as a treacherously narrow stretch of coastal path, swept by wild winds that threaten to blow travelers onto the jagged rocks below. These large canvases, weathered in Young\'s outdoor studio space by seawater and the Californian rainstorms, represent danger, violence and the fragility of life; they are his translation and portrayal of that same treacherous path. An enthusiastic surfer, he personally wrestled with this fight after falling severely ill from the Swine flu virus (H1N1) in 2010. Left unable to read, let alone work, Young pushed and punished himself to create these vast, physical paintings that stand as his testament to the possibilities of human endeavor and tenacity in the face of perilous adversity.',12,0),(23,'HATE',0,'',38,0),(24,'SCULPTURE',1,'BANKROBBER SCULPTURES\r\nA collection of unique solid bronze sculptures from Russell Young as his first series of sculptures some weighing four pounds, the Bankrobber man is cast from a solider that Russell used to play with as a child, The black patina is created from pigments hand mixed by Russell and applied at his foundry in California.\r\n\r\nThe Bankrobber series of sculptures was inspired by the \"American Envy\" series of paintings. Russell Young\'s \'American Envy\' series of paintings is an examination of American society, and addresses the idea of the American dream, exposing its fragility. By way of explanation, he says: \"Am I asking you to witness my own personal souring of the American dream, or are you being given a deeper glimpse of my lifelong obsession with American Counterculture\"',16,0),(25,'DREAMLAND',1,'\"I\'m like that moth outside my room that every night flies into the light, it burns itself but continues to fly into the light to see if the outcome will be different.\"\r\n\r\nThese abstract paintings mark a radical departure from the artist\'s previous screen based works, borrowing their titles from the sinister and ironic rhetoric of the early cold war years that had filtered into the subconscious of the artist as a boy. Los Alamos. Little Boy, Bikini Atoll . . . contrasted sharply with the grim housing project titles that shaped his environment . . . Moss Side, Easterhouse, Nant Peris. Whilst the British Broadcast Company warned a generation of children to protect themselves from the imminent threat of holocaust by lying prone beneath their school desks . . . Young chose to stand up.',13,0),(26,'COMMISSIONS',0,'',39,0),(27,'ANIMALS',0,'',40,0),(29,'LOST ANGELS',1,'Russell Young is the first and only artist ever permitted to interpret Dennis Hopper\'s photography to create his own unique works \r\n\r\nYoung\'s Lost Angels series includes pieces created from Dennis Hopper\'s photographs featuring the renowned Hells Angels Motorcycle Club (HAMC) founded in California who Hopper befriended throughout his lifetime\r\n\r\nThe one-of-a-kind series by Russell Young, the first artist granted access to the art archives of the late iconic artist and actor Dennis Hopper, since his death in 2010. Young has been permitted by The Hopper Art Trust to utilize Hopper\'s photography to create his own artworks. The works through colour and medium (silkscreen on felt and linen) bring alive Hopper\'s iconic images in a different light. This collaborative series of work is Young\'s exploration of Hopper\'s work his focus is on a range of photographs that Hopper took of the rebellious Hells Angels and the different aspects of their unconventional lifestyle in 1960s California. It was through similar interests that Hopper developed a relationship with the motorcycle group over many years and captured them at a range of events such as on the Civil Rights Movement trail and rallies. It was these powerful images that inspired Young\'s current series of work. \r\n\r\nYoung invites viewers to perceive these virtually extinct figures of American counter-culture, the so-called \"renegades of the road\" in a playful, yet more contextual manner. His juxtaposition of colour and composition creates a montage of movement and energy, punctuated only by the occasional cool posturing of youth, at a time when America began to celebrate creativity along with individuality. The subjects epitomize what became a mixture of angst and freedom of expression that was being interpreted by the youth culture in various amalgamations, now freer, but a little lost as to what to do with the liberation they were activating. \r\n\r\nThe Hopper Trust and Young saw an affinity between Young and Hopper\'s photographic interpretations. The Hopper Art Trust was honored to have Young as an artistic ambassador, who will carry forward the mantle of Hopper\'s creative legacy to a new generation of art lovers, through his vision and dedication to his craft.\r\n\r\nYoung himself met Hopper while on a film set many years ago, where they spent an afternoon musing on modern American society, photography, and filmography, as well as their life philosophies. This chance meeting further links the narrative between the artists and solidifies their connection, allowing a certain distinct layering of histories and dialogue, which lay a foundation for Young\'s personal interpretations of Hopper\'s works. \r\n\r\nThe Hopper Art Trust is committed to the preservation of the artistic career and legacy of the late iconic visionary Dennis Hopper. Hopper was a renowned actor/director and artist who experimented in all mediums including photography, video and film, painting, performance, and sculpture. HAT is responsible to maintain and operate a functional archive that serves as a resource for multi-faceted engagements in the public realm. The Hopper Art Trust was established by the Dennis Hopper Estate in 2010 and is based in Los Angeles, California. ',22,0),(30,'PORTFOLIOS',1,'Russell Young has long been fascinated by the dichotomy of the myth and reality of the \"American Dream\", which he often personifies as Hollywood glamour in contrast with our \"knowing\" of the jaded reality of celebrity. As explored in his previous collections Fame+Shame, American Envy, and This Land is My Land, Young transforms cultural icons with his signature silkscreen process, his unique color and often a glittering diamond dust finish. It is a fantastical glorification, simultaneously presenting the viewer with the tragedy of it all; finite beauty and the loss of innocence.\r\n\r\nRussell Young\'s most important female icons, in his ?Heroines Portfolio Collection? include Marilyn Superstar, Marilyn Portrait, Bardot and Jackie O.  \r\n\r\nYoung\'s first portfolio \"Marilyn Portrait\" which was released by Taglialatella Galleries last year and achieved a record price at the Christie?s auction of Prints and Multiples.\r\n\r\nWho better to evoke a powerful sequence of emotions than Jacqueline Kennedy for Young\'s second portfolio? The image chosen by Young is derived from a rare 1964 photograph of Jackie on what would have been the 47th birthday of the late JFK once of vision of youthful glamour and hope; First Lady to the most powerful man in the free world and then suddenly she is the symbol of national grief, and with time would come to symbolize the watershed moment when the hope of the 1960s was dashed at the dawn of the Vietnam War.\r\n\r\nThe portfolios are limited edition of twenty-five sets of four works (except Marilyn Super which has eight prints) on paper. All are hand-pulled unique variations with original colors mixed by the artist, each is enclosed in a black linen case with a hand-pulled silkscreen cover. Each portfolio contains a signed and numbered colophon sheet.',5,0),(31,'OBSESSIONS',0,'',41,0),(32,'KATE MOSS SUPERSTAR',1,'Kate Moss Superstar is part of an ongoing exploration into the visual nature of fame and celebrity, as Young defines the essence of what truly makes a âsuperstarâ. With his trademark vividly-colored, larger-than-life canvases, Young reinterprets iconic imagery of contemporary catwalk heroine, Kate Moss.\r\n\r\nKate Moss Superstar features a controversial photograph of Kate Moss, first published in British Vogue in early 1990, capturing the Croydon-born supermodel aged just sixteen. Taken by British photographer Kate Garner at the cusp of the nineties, this photograph reflects the very beginning of Mossâs stellar career. By embellishing and expanding upon the outtakes, Young weaves the image into his continuing exploration of the fragile nature of celebrity and its impact on both society at large and our shared internal psyche. Whilst the original image presents a natural innocence and beauty, it is through Youngâs manipulation that these paintings are elevated, transcending the restrictions of their original source material and providing a unique and very personal body of work which pays a powerful homage to one of our generationâs most celebrated icons.',10,0),(33,'MARILYN SUPERSTAR',1,'Marilyn Superstar is part of an ongoing exploration into the visual nature of fame and celebrity, as Young attempts to define the essence of what truly makes a âsuperstarâ. With his trademark vividly-colored, larger-than-life canvases, Young reinterprets iconic imagery featuring screen siren, Marilyn Monroe.\r\n\r\nMarilyn Monroe, whose instantly-recognizable features are rendered in both opulent platinum and dazzling gold and imbued with a sense of nostalgia and celebration. Following a decade of austerity in the United States, emerging from the Wall Street Crash and the ensuing Great Depression, Monroeâs rise to fame came to represent a new era of optimism that helped revive the spirits of a nation with her much publicised and often tumultuous love life, reflecting the cultural appetite of the age. Presidents, sporting heroes, and writers all fell under her spell, but it was her inherent vulnerability and untimely death that maintains Monroeâs status as the first true superstar. These works set out to serve as both a celebration and an epitaph to the Great American Dream.',21,0),(34,'MARILYN CALIFORNIA',0,'\"In Hollywood, a girl\'s virtue is much less important than her hairdo. You\'re judged by how you look, not by what you are. Hollywood\'s a place where they\'ll pay you a thousand dollars for a kiss, and fifty cents for your soul.\"\r\nMarilyn Monroe.\r\n\r\nHand-painted backgrounds and hand pulled enamel images on linen created in Russell\'s California studio. Colors named after the streets and boulevards that dissect Hollywood Blvd. Young presents us with a single defining image from his American explorations, repeated in the candy colors of a long lost California, this haunting image of America\'s most enduring icon perfectly encapsulates both the fragility and beauty of fame.',8,0),(35,'AMERICAN LANDSCAPE',1,'Russell Young questions the inherent fragility of a nation born of conflict and bloodshed, a country both young in history and heart that promises everything and fears nothing. America is a country that in less 100 years went from Native Americans \"dancing to restore the eclipsed moon\" to \"if you believed they put a man on the moon\" and continues to push any and all boundaries, always striving toward that next achievement, and then the next.',11,0),(36,'PELE',0,'',42,0),(37,'A MIDSUMMER NIGHTS DREAM',1,'Russell Young draws inspiration from the natural world in A Mid Summer Night\'s Dream, a new series of large-scale abstract oil paintings. Young looks to Lotusland at twilight to create an immersive abstract landscape in which the eye floats in suspended space. Moody indigos ranging from pastel blue to inky navy create a saturated and disorienting space reminiscent of where the ocean meets sky; day meets night. Within each composition, the artist creates beautifully rendered details pulled from nature.  The fan of a river delta, plant fossils, and coral reef all serve as source material for these masterfully quiet moments in an otherwise explosive series of compositions. Young, an artist, known for large-scale silkscreen paintings of cultural icons, stretches his creative range in this series created especially for Lotusland.\r\n\r\nIn A Mid Summer Night\'s Dream, Young looks to American Abstract Expressionism and French modernist Yves Klein in terms of scale, bold compositions and the performative aspect of the artist\'s creative process. Russell Young\'s practice is rooted in action painting: blaring Icelandic rock band Sigur Ros in his California studio, the artist uses his hands, feet, and body to leave layer upon layer of marks, lines, and smears. The canvas is placed on the studio floor, jumped on, pressed down, propped up and painted on with hands and limbs. The result is a nuanced composition that is simultaneously explosive and disciplined. Oil paints, oil sticks, pastels, charcoal, and shellac are all used to create this bold new body of work. \r\n\r\n-Yasmine Zodeh',20,0),(38,'FEMME FATALE',1,'Starring portraits of iconic, glamorous, and powerful women, these large-scale paintings celebrate a group of critical female entertainers, each of whom has influenced the artist throughout his life and continues to inspire millions. Young depicts his admiration for these ?Femme Fatales? through striking portraiture in his definitive style, combining screen printing on linen with his recognizable diamond dust signature. Each of these original, hand-pulled works have been executed at a monumental scale, indeed making the women larger than life.\r\n\r\nFemme Fatale explores Young\'s ongoing love of pop culture?s and for the diverse talents of Young?s subjects that include Brigitte Bardot, Sophia Loren, Audrey Hepburn, and Nina Simone. With this collection, the artist underscores the continuing importance and relevance of these women, now more than ever given the cultural tensions and political discourse in contemporary society.\r\n\r\nIn a statement, Young writes: ?The women of Femme Fatale are women of intelligence, sex appeal, ridiculous talent. They are all activists, humanitarians and rebellious by nature.? He pauses and concludes with the cautionary, ?They may cause death.?',3,0),(39,'KATE MOSS & PETE DOHERTY',0,'Double take: Kate Moss and Pete Doherty depicted as murderers Myra Hindley and Ian Brady.\r\nOn first glance, the chilling stare, peroxide-blonde hair and snow-white skin are unmistakably that of convicted child-killer Myra Hindley pictured in the same woolen coat she wore for her 1965 mugshot.\r\nBut on closer inspection, the mouth is noticeably more of a model pout, and the face prettier - as the person in the picture is revealed as supermodel Kate Moss. And Myra\'s evil partner Ian Brady is unveiled as her former paramour Pete Doherty. Moss, has chillingly been turned into one-half of the notorious Moors murderers by Yorkshire-born artist, Russell Young. And Babyshambles frontman Pete Doherty is shown as a babyfaced Ian Brady, Hindley\'s partner in the infamous crime spree.\r\n\r\nImages of the celebrity couple were superimposed on the original mugshots using computer technology and then printed on canvases with alternate gold and silver sheens.\r\n\r\nThe pictures were exhibited at the London Art Fair in Islington, North London, where many onlookers were convinced they were the original depiction of the Moors murderers. \r\n\r\nThe work is meant as an observation on the self-destructive hedonism of some of Britain\'s biggest celebrities, and both Moss and Doherty, who have been photographed taking cocaine, are the perfect embodiment of that.\r\n\r\nArtist Young, who is married to actress Finola Hughes of General Hospital fame, described the image as his \"ultimate picture, the perfect storm, a perfect combination of fame and shame\".\r\n\r\nDaily Mail.',43,0),(40,'WEST',1,'I am rain, horses, whiskey,\r\nmurder, chaos, terror, gasoline,\r\nlust, heartbreak, damnation, love,\r\nHollywood, lost, paranoia, horror,\r\nviolence, redemption, rattlesnakes,\r\nsage, desert, raven, rolling thunder,\r\nHells Angel, cowboys, girls,\r\nrustlers, riot, cold wind,\r\nthe Pacific and dust and death and God.\r\nWest.',44,0),(41,'MUHAMMAD ALI',1,'<q>If the measure of greatness is to gladden the heart of every human being on the face of the earth, then he truly was the greatest. In every way he was the bravest, the kindest and the most excellent of men.</q>\r\n\r\nBob Dylan on Muhammad Ali',6,0),(42,'BIZARRE LOVE TRIANGLE',0,'Flowers',45,0),(43,'WONDERLAND',0,'',30,0),(44,'FAME',1,'',1,0),(45,'CHINA ICONS',0,'',46,0),(46,'YOUNG AMERICANS',1,'\"All night\r\nShe wants a young American\r\nYoung American, young American, she wants the young American\r\nAll night\r\nBut she wants the young American\r\nScanning life through the picture window \r\nShe finds the slinky vagabond\r\nHe coughs as he passes her Ford Mustang\r\nBut Heaven forbid, she\'ll take anything\r\nBut the freak, and his type, all for nothing\r\nMisses a step and cuts his hand, but\r\nShowing nothing, he swoops like a song\r\nShe cries, \"Where have all Papa\'s heroes gone?\"\r\n\r\nDavid Bowie 1974',2,0),(47,'SUPREME',0,'\"We should all start to live before we get too old. Fear is stupid. So are regrets\"\r\nMarilyn Monroe.\r\n\r\nIn Marilyn Crying, Young presents us with a single defining image from his American explorations, repeated in the candy colors of a long lost California, this haunting image of America\\\'s most enduring icon perfectly encapsulates both the fragility and beauty of fame.',7,0);
